import "./style.css";

import { Link } from 'react-router-dom';

import DefaulterIcon from "../../../assets/defaulter.svg";
import ExpandedIcon from "../../../assets/expanded.svg";

function CardListClients({ status, list, count }) {
  return (
    <article className="Clients CardContainer">
      <section className="CardTitle">
        <div className="CardIcon">
            <img
              src={status === "defaulter" ? DefaulterIcon : ExpandedIcon}
              alt="Icon"
              className="Icon"
            />
            <h1 className="TypeOfClientTitle">
              {status === "defaulter" ? "Clientes Inadimplentes" : "Clientes em dia"}
            </h1>
        </div>
        <p className={status === "defaulter" ? "ClientCount Red" : "ClientCount Green"}>
          {count}
        </p>
      </section>
      <article className="TableContainer">
        <header className="TableHead">
          <strong className="ListTop TableColumn FirstColumn">
            Clientes
          </strong>
          <strong className="ListTop TableColumn MidColumn">
            ID do clie.
          </strong>
          <strong className="ListTop TableColumn LastColumns">
            CPF
          </strong>
        </header>
        <section className="TableBody">
          {list.map((item) => (
              <div className="TableRow" key={item.id}>
                <span className="ListEachLine TableColumn FirstColumn">{item.name}</span>
                <span className="ListEachLine TableColumn MidColumns">
                  {item.id}
                </span>
                <span className="ListEachLine TableColumn LastColumns">
                  {item.cpf}
                </span>
              </div>
          ))}
        </section>
        <div className="CardBottom">
          <Link className="ShowEverything" to='/debt-collection'>Ver todos</Link>
        </div>
      </article>
    </article>
  );
}

export default CardListClients;
